BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "ErrorLog" (
	"ErrorLogID"	INTEGER,
	"ErrorTime"	DATETIME NOT NULL DEFAULT (datetime('now')),
	"UserName"	TEXT NOT NULL,
	"ErrorNumber"	INTEGER NOT NULL,
	"ErrorSeverity"	INTEGER,
	"ErrorState"	INTEGER,
	"ErrorProcedure"	TEXT,
	"ErrorLine"	INTEGER,
	"ErrorMessage"	TEXT NOT NULL,
	PRIMARY KEY("ErrorLogID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "BuildVersion" (
	"SystemInformationID"	INTEGER,
	"Database Version"	TEXT NOT NULL,
	"VersionDate"	DATETIME NOT NULL,
	"ModifiedDate"	DATETIME NOT NULL DEFAULT (datetime('now')),
	PRIMARY KEY("SystemInformationID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Address" (
	"AddressID"	INTEGER,
	"AddressLine1"	TEXT NOT NULL,
	"AddressLine2"	TEXT,
	"City"	TEXT NOT NULL,
	"StateProvince"	TEXT NOT NULL,
	"CountryRegion"	TEXT NOT NULL,
	"PostalCode"	TEXT NOT NULL,
	"rowguid"	TEXT NOT NULL UNIQUE,
	"ModifiedDate"	DATETIME NOT NULL DEFAULT (datetime('now')),
	PRIMARY KEY("AddressID")
);
CREATE TABLE IF NOT EXISTS "Customer" (
	"CustomerID"	INTEGER,
	"NameStyle"	INTEGER NOT NULL DEFAULT (0),
	"Title"	TEXT,
	"FirstName"	TEXT NOT NULL,
	"MiddleName"	TEXT,
	"LastName"	TEXT NOT NULL,
	"Suffix"	TEXT,
	"CompanyName"	TEXT,
	"SalesPerson"	TEXT,
	"EmailAddress"	TEXT,
	"Phone"	TEXT,
	"PasswordHash"	TEXT NOT NULL,
	"PasswordSalt"	TEXT NOT NULL,
	"rowguid"	TEXT NOT NULL UNIQUE,
	"ModifiedDate"	DATETIME NOT NULL DEFAULT (datetime('now')),
	PRIMARY KEY("CustomerID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "CustomerAddress" (
	"CustomerID"	INTEGER NOT NULL,
	"AddressID"	INTEGER NOT NULL,
	"AddressType"	TEXT NOT NULL,
	"rowguid"	TEXT NOT NULL UNIQUE,
	"ModifiedDate"	DATETIME NOT NULL DEFAULT (datetime('now')),
	PRIMARY KEY("CustomerID","AddressID"),
	FOREIGN KEY("CustomerID") REFERENCES "Customer"("CustomerID"),
	FOREIGN KEY("AddressID") REFERENCES "Address"("AddressID")
);
CREATE TABLE IF NOT EXISTS "Product" (
	"ProductID"	INTEGER,
	"Name"	TEXT NOT NULL UNIQUE,
	"ProductNumber"	TEXT NOT NULL UNIQUE,
	"Color"	TEXT,
	"StandardCost"	INTEGER NOT NULL,
	"ListPrice"	INTEGER NOT NULL,
	"Size"	TEXT,
	"Weight"	INTEGER,
	"ProductCategoryID"	INTEGER,
	"ProductModelID"	INTEGER,
	"SellStartDate"	DATETIME NOT NULL,
	"SellEndDate"	DATETIME,
	"DiscontinuedDate"	DATETIME,
	"ThumbNailPhoto"	BLOB,
	"ThumbnailPhotoFileName"	TEXT,
	"rowguid"	TEXT NOT NULL UNIQUE,
	"ModifiedDate"	DATETIME NOT NULL DEFAULT (datetime('now')),
	FOREIGN KEY("ProductModelID") REFERENCES "ProductModel"("ProductModelID"),
	FOREIGN KEY("ProductCategoryID") REFERENCES "ProductCategory"("ProductCategoryID"),
	PRIMARY KEY("ProductID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "ProductCategory" (
	"ProductCategoryID"	INTEGER,
	"ParentProductCategoryID"	INTEGER,
	"Name"	TEXT NOT NULL UNIQUE,
	"rowguid"	TEXT NOT NULL UNIQUE,
	"ModifiedDate"	DATETIME NOT NULL DEFAULT (datetime('now')),
	PRIMARY KEY("ProductCategoryID" AUTOINCREMENT),
	FOREIGN KEY("ParentProductCategoryID") REFERENCES "ProductCategory"("ProductCategoryID")
);
CREATE TABLE IF NOT EXISTS "ProductDescription" (
	"ProductDescriptionID"	INTEGER,
	"Description"	TEXT NOT NULL,
	"rowguid"	TEXT NOT NULL UNIQUE,
	"ModifiedDate"	DATETIME NOT NULL DEFAULT (datetime('now')),
	PRIMARY KEY("ProductDescriptionID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "ProductModel" (
	"ProductModelID"	INTEGER,
	"Name"	TEXT NOT NULL UNIQUE,
	"CatalogDescription"	TEXT,
	"rowguid"	TEXT NOT NULL UNIQUE,
	"ModifiedDate"	DATETIME NOT NULL DEFAULT (datetime('now')),
	PRIMARY KEY("ProductModelID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "ProductModelProductDescription" (
	"ProductModelID"	INTEGER NOT NULL,
	"ProductDescriptionID"	INTEGER NOT NULL,
	"Culture"	TEXT NOT NULL,
	"rowguid"	TEXT NOT NULL UNIQUE,
	"ModifiedDate"	DATETIME NOT NULL DEFAULT (datetime('now')),
	FOREIGN KEY("ProductModelID") REFERENCES "ProductModel"("ProductModelID"),
	FOREIGN KEY("ProductDescriptionID") REFERENCES "ProductDescription"("ProductDescriptionID"),
	PRIMARY KEY("ProductModelID","ProductDescriptionID","Culture")
);
CREATE TABLE IF NOT EXISTS "SalesOrderDetail" (
	"SalesOrderID"	INTEGER NOT NULL,
	"SalesOrderDetailID"	INTEGER IDENTITY(1, 1) NOT NULL,
	"OrderQty"	INTEGER NOT NULL,
	"ProductID"	INTEGER NOT NULL,
	"UnitPrice"	INTEGER NOT NULL,
	"UnitPriceDiscount"	INTEGER NOT NULL DEFAULT (0.0),
	"LineTotal"	INTEGER NOT NULL,
	"rowguid"	TEXT NOT NULL UNIQUE,
	"ModifiedDate"	DATETIME NOT NULL DEFAULT (datetime('now')),
	FOREIGN KEY("ProductID") REFERENCES "Product"("ProductID"),
	FOREIGN KEY("SalesOrderID") REFERENCES "SalesOrderHeader"("SalesOrderID"),
	PRIMARY KEY("SalesOrderID","SalesOrderDetailID")
);
CREATE TABLE [SalesOrderHeader](
    [SalesOrderID] INTEGER PRIMARY KEY AUTOINCREMENT,
    [RevisionNumber] INTEGER NOT NULL DEFAULT (0),
    [OrderDate] DATETIME NOT NULL CONSTRAINT [DF_SalesOrderHeader_OrderDate] DEFAULT (datetime('now')),
    [DueDate] DATETIME NOT NULL,
    [ShipDate] DATETIME NULL,
    [Status] INTEGER NOT NULL DEFAULT (1),
    [OnlineOrderFlag] INTEGER NOT NULL DEFAULT (1),
    [SalesOrderNumber] TEXT UNIQUE NOT NULL, 
    [PurchaseOrderNumber] INTEGER NULL,
    [AccountNumber] TEXT NULL,
    [CustomerID] INTEGER NOT NULL,
	[ShipToAddressID] int,
	[BillToAddressID] int,
    [ShipMethod] TEXT NOT NULL,
    [CreditCardApprovalCode] TEXT NULL,    
    [SubTotal] INTEGER NOT NULL DEFAULT (0.00),
    [TaxAmt] INTEGER NOT NULL DEFAULT (0.00),
    [Freight] INTEGER NOT NULL DEFAULT (0.00),
    [TotalDue] INTEGER NOT NULL,
    [Comment] TEXT NULL,
    [rowguid] TEXT UNIQUE NOT NULL,
    [ModifiedDate] DATETIME NOT NULL DEFAULT (datetime('now')),
    FOREIGN KEY ([CustomerID]) REFERENCES [Customer](CustomerID),
    FOREIGN KEY ([ShipToAddressID]) REFERENCES [Address](AddressID),
    FOREIGN KEY ([BillToAddressID]) REFERENCES [Address](AddressID)
);
CREATE INDEX IF NOT EXISTS "IX_Address_AddressLine1_AddressLine2_City_StateProvince_PostalCode_CountryRegion" ON "Address" (
	"AddressLine1",
	"AddressLine2",
	"City",
	"StateProvince",
	"PostalCode",
	"CountryRegion"
);
CREATE INDEX IF NOT EXISTS "IX_Address_StateProvince" ON "Address" (
	"StateProvince"
);
CREATE INDEX IF NOT EXISTS "IX_Customer_EmailAddress" ON "Customer" (
	"EmailAddress"
);
CREATE INDEX IF NOT EXISTS "IX_SalesOrderDetail_ProductID" ON "SalesOrderDetail" (
	"ProductID"
);
CREATE INDEX IF NOT EXISTS "IX_SalesOrderHeader_CustomerID" ON "SalesOrderHeader" (
	"CustomerID"
);
COMMIT;
